import { TodoCounter } from './TodoCounter';
import { TodoSearch } from './TodoSearch';
import { TodoList } from './TodoList';
import { CreateTodoButoon } from './CreateTodoButoon';
import { TodoItem } from './TodoItem';
import React from 'react';
import './App.css';

const defaultTodos = [
  { text: 'Cortar tomato', completed: true },
  { text: 'Cortar apple', completed: false },
  { text: 'Cortar lettuce', completed: true },
  { text: 'Cortar onion', completed: true },

];

// when the function name starts with a capital letter it is 99% a REACT component
function App() {
  return (
    //we used xml width js
    //labels in lowercase convert them into REACT elements, then transform REACT component
    // <div className="App">
    <React.Fragment>
      <TodoCounter completed={16} total={25} />


      <TodoSearch />

      <TodoList>
        <TodoItem/>
        <TodoItem/>
        <TodoItem/>
      </TodoList>
      <CreateTodoButoon/>
      </React.Fragment>
    // </div>
  );
}




export default App;
